import ImageSlider from "./ImageSlider";

const App = () => {
  const slides = [
    { url: "https://www.pexels.com/photo/seaside-994605/", title: "beach" },
    { url: "https://www.pexels.com/photo/person-in-black-shirt-and-blue-denim-jeans-sitting-on-boat-5416429/", title: "boat" },
    { url: "https://www.pexels.com/photo/green-leafed-tree-38136/", title: "forest" },
    { url: "https://www.pexels.com/photo/empire-state-building-new-york-466685/", title: "city" },
    { url: "https://images.pexels.com/photos/2064827/pexels-photo-2064827.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2", title: "italy" }
  ];
  const containerStyles = {
    width: "500px",
    height: "280px",
    margin: "0 auto",
  };
  return (
    <div>
      <h1>Hello </h1>
      <div style={containerStyles}>
        <ImageSlider slides={slides} />
      </div>
    </div>
  );}

export default App;
